import React from 'react';

export const Song = (props) => {
    let song = props.song;
    let handleFavorites = props.handleClick;
    const handleDelete = () => {
        props.handleDelete(song);
    }
	return (
		<div className='songs'>
			<div className='songs-top'>
				<p>{song.title}</p>
				<p>{song.artist}</p>
				<button onClick={handleFavorites}>Favorite</button>
			</div>
			<div className='songs-bottom'>
				<p>{song.time}</p>
			</div>
            <button onClick={handleDelete}>Delete</button>
		</div>
	);
};
